function closeNav(){
if (event.currentTarget.className!=" mobile")
	closeSideNav(true); //currenTarget yg bukan mobile adalah closebtn satu-satunya.
else if (event.target.parentNode.parentNode.className!="sidenav" && event.target.parentNode.className!="sidenav" && event.target.className!="sidenav"){ //apapun yg bukan keluarga sidenav
	closeSideNav(true);
} else {
if(event.type=="touchstart")return;
}
if (event.target.tagName=="A") 
   closeSideNav(false);
}

